import { Container } from '../styles/pages/Login';

import Tilt from 'react-tilt';
import Image from 'next/image';

const Login: React.FC = () => (
    <Container>
        <Tilt options={{ max: 25, maxTilt: 20, glare: true, maxGlare: 1, perspective: 100, easing: "cubic-bezier(.03,.98,.52,.99)", scale: 1 }}>
            <Image src="/assets/laptop.png" width="100px" height="100px" />

        </Tilt>
    </Container>
)

export default Login;
